import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { fetchStudents } from '../api/studentAPI'; // Corrected import
import './VerticalNavBar.css';

function VerticalNavBar({
    onFilterChange,
    toggleCompanyList,
    showCompanyList,
    schoolFilter,
    yearFilter,
    typeFilter,
    setSchoolFilter,
    setYearFilter,
    setTypeFilter,
}) {
    const [tooltip, setTooltip] = useState('');
    const [tooltipPosition, setTooltipPosition] = useState({ top: 0, left: 0 });

    const schools = ['SMEC', 'SCOPE', 'SENSE'];
    const types = [
        'Super dream internship',
        'Super dream offer',
        'Dream offer',
        'Dream internship',
        'Restricted dream',
    ];
    const years = [2023, 2024, 2025];

    // Handle mouse enter for tooltips
    const handleMouseEnter = (text, event) => {
        setTooltip(text);
        const { top, left, height } = event.currentTarget.getBoundingClientRect();
        setTooltipPosition({ top: top + height + window.scrollY, left });
    };

    const handleMouseLeave = () => setTooltip('');

    // Function to handle filter changes
    const handleFilterChange = (filterType, value) => {
        if (filterType === 'School') {
            setSchoolFilter(value);
        } else if (filterType === 'Year') {
            setYearFilter(value);
        } else if (filterType === 'Type') {
            setTypeFilter(value);
        }
    };

    // Fetch students based on current filters when any filter changes
    useEffect(() => {
        const getFilteredStudents = async() => {
            try {
                const response = await fetchStudents(
                    'All Students', // Or other filter type like 'Placed'
                    yearFilter,
                    '', // Empty search term (you can update this if needed)
                    schoolFilter,
                    typeFilter
                );
                console.log('Filtered students:', response);
            } catch (error) {
                console.error('Error fetching filtered students:', error);
            }
        };

        getFilteredStudents();
    }, [schoolFilter, yearFilter, typeFilter]); // Trigger when any of the filters change

    return ( <
        div className = "vertical-nav" > { /* Filter Buttons */ } <
        button onClick = {
            () => onFilterChange('All Students') } > All Students < /button> <
        button onClick = {
            () => onFilterChange('Placed') } > Placed Students < /button> <
        button onClick = {
            () => onFilterChange('Not placed') } > Not Placed Students < /button>

        { /* School filter */ } <
        select value = { schoolFilter || '' }
        onChange = {
            (e) => handleFilterChange('School', e.target.value) }
        onMouseEnter = {
            (e) => handleMouseEnter('Filter by school.', e) }
        onMouseLeave = { handleMouseLeave } >
        <
        option value = "" > Select School < /option> {
            schools.map((school) => ( <
                option key = { school }
                value = { school } > { school } <
                /option>
            ))
        } <
        /select>

        { /* Year filter */ } <
        select value = { yearFilter || '' }
        onChange = {
            (e) => handleFilterChange('Year', e.target.value) }
        onMouseEnter = {
            (e) => handleMouseEnter('Filter by year.', e) }
        onMouseLeave = { handleMouseLeave } >
        <
        option value = "" > Select Year < /option> {
            years.map((year) => ( <
                option key = { year }
                value = { year } >
                Year { year } <
                /option>
            ))
        } <
        /select>

        { /* Type filter */ } <
        select value = { typeFilter || '' }
        onChange = {
            (e) => handleFilterChange('Type', e.target.value) }
        onMouseEnter = {
            (e) => handleMouseEnter('Filter by type of offer or internship.', e) }
        onMouseLeave = { handleMouseLeave } >
        <
        option value = "" > Select Type < /option> {
            types.map((type) => ( <
                option key = { type }
                value = { type } > { type } <
                /option>
            ))
        } <
        /select>

        { /* Toggle company list visibility */ } <
        button onClick = { toggleCompanyList } > { showCompanyList ? 'Hide Companies' : 'Companies Visited' } <
        /button>

        { /* Job notifications link */ } <
        Link to = "/job-notifications"
        className = "nav-link" >
        Job Notifications <
        /Link>

        { /* Tooltip */ } {
            tooltip && ( <
                div className = "tooltip"
                style = {
                    { top: tooltipPosition.top, left: tooltipPosition.left } } > { tooltip } <
                /div>
            )
        } <
        /div>
    );
}

export default VerticalNavBar;
